const Movies = () => {
  const { Search } = useSelector((state) => state.movies);

  const dispatch = useDispatch();

  console.log("MOVIESSSSSSSSSS", Search);

  return (
    <div className='moviesMainDiv'>
      {Search && Search.map((movie, index) => {
        return (
          <div key={movie.imdbID}>
            <h1>{movie.Title}</h1>
            <img src={movie.Poster}></img>
          </div>
        );
      })}
    </div>
  );
};

export default Movies;
